import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <div className="dashboard ms-5">
                    <p className='location-header'>PRAKTIKUM 1/Home</p>
                    <br></br><br></br><br></br><br></br><br/><br/><br/>
                            <h5 className="card-title display-3 fw-bolder mb-0">REACT</h5>
                            <p className="card-text lead fs-2 mb-0">PRAKTIKUM 1</p>
                            <p className="card-text lead mb-5">- OLIVIRA -</p>
                         <br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/>
               
            </div>
                
    );
};

export default Home;
